(1, 0, 'Giới thiệu Website', '', 'gioi-thieu-website', '', 'Sinh năm 1990, Shin Se Kyung được xem là ngôi sao trẻ nổi tiếng qua nhiều bộ phim truyền hình và điện ảnh. Tuy nhiên, cũng không ít fan tỏ ra khó chịu với hình tượng nhân vật nữ chính mà Shin Se Kyung từng thủ vai trong drama Khi người đàn ông yêu, đóng c', '', 'Sinh năm 1990, Shin Se Kyung được xem là ngôi sao trẻ nổi tiếng qua nhiều bộ phim truyền hình và điện ảnh. Tuy nhiên, cũng không ít fan tỏ ra khó chịu với hình tượng nhân vật nữ chính mà Shin Se Kyung từng thủ vai trong drama Khi người đàn ông yêu, đóng cặp cùng Song Seung Heon.\r\n\r\nVai diễn mới nhất của kiều nữ 9X này nằm trong bộ phim điện ảnh Tazza: Bàn tay của chúa, phần 2. Trong phim, nữ diễn viên trẻ không ngại đóng cảnh nóng thật với việc để lộ vòng ba trên màn ảnh.\r\n\r\nHai kiều nữ 9X sẵn sàng đóng cảnh "nóng" thật - 1\r\n\r\nShin Se Kyung tự mình đóng cảnh nóng lộ vòng ba mà không cần diễn viên đóng thế.\r\n\r\nChia sẻ về cảnh quay này, Shin Se Kyung cho biết, đúng là cô đã tự mình đóng cảnh nude mà không cần đến diễn viên đóng thế.\r\n\r\n“Khi đọc kịch bản gốc, tôi hiểu rằng đó là một chi tiết quan trọng. Là một điểm trọng tâm trong phim nên tôi không thể nào lảng tránh”, Shin Se Kyung giải thích. “Tôi không cảm thấy gánh nặng khi đóng cảnh này. Tôi đã chuẩn bị rất nhiều. Những gì tôi nhớ về cảnh quay là khi đó tôi rất đói, bụng kêu lục đục. Tôi muốn thể hiện một hình ảnh hoàn toàn mới của bản thân mình”.\r\n\r\nNói về vai diễn Mina trong phần 2 của Tazza, Shin Se Kyung tự mình nhận xét về nhân vật này: “Đó là một cô gái tạo ra cơ hội tốt nhất giúp anh chàng Dae Gil – nhân vật chính trong phim”.\r\n\r\nHai kiều nữ 9X sẵn sàng đóng cảnh "nóng" thật - 2\r\n\r\nHai diễn viên trẻ T.O.P và Shin Se Kyung thành một cặp đôi trong phần 2 của phim Tazza\r\n\r\nBộ phim về đề tài sòng bài này xoay quanh cuộc đấu trí giữa các nhóm chơi bài, trong đó Mina (Shin Se Kyung) về phe của Dae Gil (T.O.P). Trong phim, hai ngôi sao trẻ T.O.P và Shin Se Kyung đều có một cảnh khỏa thân ngắn.\r\n\r\n“Bầu không khí khi đó khá thân thiện và độc đáo. Có một nhóm người đàn ông khỏa thân trong cảnh này. Chúng tôi không quen với điều đó. Vì vậy chúng tôi thậm chí không thể nhìn nhau trực tiếp trong lúc máy quay ghi hình. Các nữ diễn viên cũng nude nên chúng tôi không biết mình nên nhìn đi đâu cho phải”, Shin Se Kyung nói.\r\n\r\nLim Ji Yeon\r\n\r\nLà một gương mặt mới trên màn ảnh rộng xứ Hàn nhưng khi đóng cặp cùng Song Seung Heon trong phim điện ảnh 19+ Human Addiction, tên tuổi của Lim Ji Yeon ngay lập tức được chú ý.\r\n\r\nNgôi sao 9X mang nhiều nét thanh mảnh, dịu dàng này lại rất táo bạo trong những cảnh nóng tay đôi với tiền bối.\r\n\r\nHai kiều nữ 9X sẵn sàng đóng cảnh "nóng" thật - 3\r\n\r\nLim Ji Yeon mỏng manh trên tạp chí Instlyle.\r\n\r\nTrong câu chuyện tình yêu giữa một đại tá trong quân đội Hàn và vợ của thuộc hạ, Lim Ji Yeon phải quay cảnh giường chiếu. Vào thời điểm trước khi phim ra rạp, qua trailer 19+, người xem đã phần nào cảm nhận được độ nóng của những cảnh “yêu” giữa Lim Ji Yeon và Song Seung Heon.', '', '/uploads/gioithieu/GpnjTSZ4Ekke6plePqTb_caf_580_©eliannalev.jpg', 'packages/anahkiasen/illuminage/9f0d285544074de8a55f117f611a2e45.jpg', 1, 1, 10, 'Giới thiệu Website', '', 'Giới thiệu Website', '', 'Giới thiệu Website', '', '0000-00-00 00:00:00', '2014-09-05 22:39:12', NULL),
(2, 0, '10 mỹ nam phản diện trong thế giới siêu anh hùng', '', '10-my-nam-phan-dien-trong-the-gioi-sieu-anh-hung', '', 'Đã qua cái thời nhân vật phản diện phải xấu xí, dị hợm, đáng ghét. Các ác nhân trong dòng phim siêu anh hùng hiện đại ngày nay có độ hấp dẫn lạ thường.', '', 'Frank Grillo (Brock Rumlow trong Captain America: The Winter Soldier): Tuy không còn ở độ tuổi trẻ trung như nhiều diễn viên khác của thế giới phim siêu anh hùng (51 tuổi), Frank Grillo vẫn gây được ấn tượng bởi khuôn mặt đẹp, nam tính đậm chất Ý và hình thể săn chắc đáng ngưỡng mộ.\r\nAnh từng góp mặt trong nhiều tác phẩm truyền hình lẫn điện ảnh nổi tiếng như Prison Break, Blind Justice, Warrior,Zero Dark Thirty… và mới đây nhất là vai phản diện Brock Rumlow trong Captain America: The Winter Soldier. Vai diễn này không quá thử thách đối với khả năng của Grillo nhưng anh vẫn khiến người xem chú ý bởi tạo hình cực “ngầu” cùng phong cách diễn xuất tự nhiên, trơn tru. Nhân vật này được cho là sẽ trở thành ác nhân Crossbones trong các bộ phim tiếp theo của Marvel.\r\nBằng sự lịch lãm, quyến rũ điển hình của một “quý ông người Anh”, Matthew Goode khắc họa thành công nhân vật Ozymandias - một siêu anh hùng được mệnh danh là “người đàn ông thông minh nhất hành tinh” nhưng sau đó đã biến thành nhân vật phản diện vì lý tưởng của chính hắn.', '', '/uploads/gioithieu/kQy8oQsY2fNNALDTn8uo_logo.png', 'packages/anahkiasen/illuminage/bad870e3ef74a804b84899c7b7eb2e73.png', 1, 1, 0, '', '', '', '', '', '', '0000-00-00 00:00:00', '2014-09-05 23:02:57', NULL),
(3, 0, 'Tưng bừng khuyến mãi nhân dip khai truong trang web', '', 'tung-bung-khuyen-mai-nhan-dip-khai-truong-trang-web', '', 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one ', '', 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of "de Finibus Bonorum et Malorum" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, "Lorem ipsum dolor sit amet..", comes from a line in section 1.10.32.\r\n\r\nThe standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from "de Finibus Bonorum et Malorum" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.', '', '/uploads/gioithieu/0pWfcvX8Uge6lvVcBe6t_473710-grindhouse-coffee-shop.jpg', 'packages/anahkiasen/illuminage/7ae5d0a9a768b85ac44a006144d998e1.jpg', 1, 1, 0, '', '', '', '', '', '', '2014-09-06 05:39:17', '2014-09-06 05:40:31', NULL),
