--
-- Table structure for table `de_product`
--

CREATE TABLE IF NOT EXISTS `de_product` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `hienthi` tinyint(4) NOT NULL,
  `is_new` tinyint(4) NOT NULL,
  `is_variant` tinyint(4) NOT NULL,
  `is_stock` tinyint(4) NOT NULL,
  `price` float(8,2) NOT NULL,
  `noibat` tinyint(4) NOT NULL,
  `thietke` tinyint(4) NOT NULL,
  `luotxem` int(11) NOT NULL,
  `solandathang` int(11) NOT NULL,
  `ten_vi` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `ten_en` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `slug_vi` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `slug_en` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `noidung_vi` text COLLATE utf8_unicode_ci NOT NULL,
  `noidung_en` text COLLATE utf8_unicode_ci NOT NULL,
  `thongso_vi` text COLLATE utf8_unicode_ci NOT NULL,
  `thongso_en` text COLLATE utf8_unicode_ci NOT NULL,
  `photo` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `thumb` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `xuatxu` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `baohanh` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `title_seo_vi` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `title_seo_en` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `desc_seo_vi` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `desc_seo_en` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `keyword_seo_vi` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `keyword_seo_en` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `photo_mask` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `isDesign` tinyint(4) NOT NULL,
  `isCase` tinyint(4) NOT NULL,
  `isSkin` tinyint(4) NOT NULL,
  `isDisplayHome` tinyint(4) NOT NULL,
  `isBack` tinyint(4) NOT NULL,
  `photo_back` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `photo_back_mask` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `isCircleLayer` tinyint(4) NOT NULL,
  `photo_circle` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `photo_circle_mask` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=17 ;

