(15, 1, 1, 0, 1, 200000.00, 1, 0, 715, 0, 'cup', '', 'cup', '', '<div class="title_news" style="margin: 10px 0px 0px; padding: 0px 0px 10px; width: 480.015625px; float: left; font-family: arial; font-size: 12px; line-height: normal;">\r\n<p style="text-align:justify">Rời khỏi cuộc thi Hoa hậu Việt Nam 2012 với ngôi vị Á hậu 2, Hoàng Anh vẫn giữ được hình ảnh "sạch sẽ". Cô ít khi xuất hiện trong các bộ ảnh quá khêu gợi, không dính vào các scandal. Thậm chí người đẹp này còn có phong cách thời trang cũng rất an toàn, cô&nbsp;luôn tránh&nbsp;ăn vận hở hang tục tĩu, hiếm khi khoe đồ hiệu đắt tiền, ưa chuộng thời trang giá bình dân. Cũng bởi quá cẩn trọng bảo vệ hình ảnh dẫn tới sự thể hiện trước công chúng còn e dè&nbsp;nên Hoàng Anh dường như chưa thực sự nổi bật so với các hoa hậu, á hậu khác đăng quang những năm&nbsp;gần đây.&nbsp;</p>\r\n\r\n<p style="text-align:center"><img alt="" src="http://24h-static.24hstatic.com/images/2014/share-fb.gif" style="border:0px; height:20px; max-width:400px; width:67px" />&nbsp;<img alt="" src="http://24h-static.24hstatic.com/images/2014/share-gg.gif" style="border:0px; height:20px; max-width:400px; width:67px" /><img alt="Á hậu Hoàng Anh đón tuổi 22 bằng bộ ảnh nội y gợi cảm - 1" class="news-image" id="news-image-id-0" src="http://24h-img.24hstatic.com/upload/3-2015/images/2015-08-19/1439971897-1439970050-a.jpg" style="border:0px; max-width:400px" /></p>\r\n\r\n<p style="text-align:center">Á hậu Hoàng Anh thực hiện bộ ảnh đánh dấu tuổi 22</p>\r\n\r\n<p style="text-align:justify">Hôm nay (19/8) là sinh nhật của á&nbsp;hậu Hoàng Anh. Nhân dịp&nbsp;kỷ niệm ngày bước sang tuổi 22, cô đã thực hiện bộ ảnh gợi cảm, đánh dấu sự trưởng thành của mình sau 3 năm đăng quang Á hậu Việt Nam 2012. Dưới&nbsp;ống kính của nữ nhiếp ảnh 9X Dạ Miêu, Hoàng Anh tự tin&nbsp;khoe vẻ đẹp thanh xuân mơn mởn đầy sức sống. Người đẹp Hà thành mặc nội y và đồ ngủ, không ngại phô bày đường cong quyến rũ.&nbsp;</p>\r\n\r\n<p style="text-align:justify">Hoàng Anh bộc bạch vào&nbsp;thời điểm đăng quang, cô từng mất tự ti vì thân hình quá mũm mĩm. Tuy nhiên, khi đã giảm cân thành công, cô đã&nbsp;tự&nbsp;<a class="TextlinkBaiviet" href="http://www.24h.com.vn/" style="text-decoration: none; color: rgb(0, 0, 255);">tin</a>&nbsp;hơn với&nbsp;cơ thể của mình. Đã nửa năm im ắng, lần này, khi trở lại showbiz, Hoàng Anh đã có định hướng rõ ràng hơn ở phong cách bản thân. Cô sẽ&nbsp;tích cực đẩy mạnh hình ảnh theo hướng sexy&nbsp;hiện đại.&nbsp;</p>\r\n\r\n<p style="text-align:justify"><em>Cùng ngắm nhìn những hình ảnh xinh đẹp, trưởng thành của Hoàng Anh:</em></p>\r\n\r\n<p style="text-align:center"><img alt="" src="http://24h-static.24hstatic.com/images/2014/share-fb.gif" style="border:0px; height:20px; max-width:400px; width:67px" />&nbsp;<img alt="" src="http://24h-static.24hstatic.com/images/2014/share-gg.gif" style="border:0px; height:20px; max-width:400px; width:67px" /><img alt="Á hậu Hoàng Anh đón tuổi 22 bằng bộ ảnh nội y gợi cảm - 2" class="news-image" id="news-image-id-1" src="http://24h-img.24hstatic.com/upload/3-2015/images/2015-08-19/1439971897-1439970050-a1.jpg" style="border:0px; max-width:400px" /></p>\r\n\r\n<p style="text-align:center">Cô mặc nội y khoe cơ thể tràn ngập vẻ đẹp thanh xuân</p>\r\n\r\n<p style="text-align:center"><img alt="" src="http://24h-static.24hstatic.com/images/2014/share-fb.gif" style="border:0px; height:20px; max-width:400px; width:67px" />&nbsp;<img alt="" src="http://24h-static.24hstatic.com/images/2014/share-gg.gif" style="border:0px; height:20px; max-width:400px; width:67px" /><img alt="Á hậu Hoàng Anh đón tuổi 22 bằng bộ ảnh nội y gợi cảm - 3" class="news-image" id="news-image-id-2" src="http://24h-img.24hstatic.com/upload/3-2015/images/2015-08-19/1439971897-1439970050-a2.jpg" style="border:0px; max-width:400px" /></p>\r\n\r\n<p style="text-align:center"><img alt="" src="http://24h-static.24hstatic.com/images/2014/share-fb.gif" style="border:0px; height:20px; max-width:400px; width:67px" />&nbsp;<img alt="" src="http://24h-static.24hstatic.com/images/2014/share-gg.gif" style="border:0px; height:20px; max-width:400px; width:67px" /><img alt="Á hậu Hoàng Anh đón tuổi 22 bằng bộ ảnh nội y gợi cảm - 4" class="news-image" id="news-image-id-3" src="http://24h-img.24hstatic.com/upload/3-2015/images/2015-08-19/1439971897-1439970050-a3.jpg" style="border:0px; max-width:400px" /></p>\r\n</div>\r\n', '', '', '', '/uploads/sanpham/jVrTVooxQCNJwSfBDMmJ_espresso-cup.jpg', '/packages/anahkiasen/illuminage/a009f7fdf4d266b29dac9ab4a56798e1.jpg', '', '', NULL, '2015-03-14 09:55:39', '2016-03-19 05:49:26', '', '', '', '', '', '', '/uploads/sanpham/wEI5Hu3m9lYrSt5y1fHF_espresso-cup - mask.png', 1, 1, 0, 1, 1, '/uploads/sanpham/ESQnPS21bvn7TzXadSpW_Ly Su  Minh Long.jpg.jpg', '/uploads/sanpham/oRgXOhgBUlr3WQpEio2d_Ly Su  Minh Long.jpg.png', 1, '/uploads/sanpham/JJsCHxatmvHxbZOG9xKH_lysu.png', '/uploads/sanpham/7n3hicS3SN7aNNHUmLy1_lysu-vong.png'),
