(1, 1, '2,3,5', 'Nga sửa đổi học thuyết quân sự để đối phó NATO', 'Tn Tuc', 'nga-sua-doi-hoc-thuyet-quan-su-de-doi-pho-nato', '', 'Hội đồng An ninh Nga hôm nay cho biết sẽ cập nhật học thuyết quân sự của nước này vào cuối năm nay, nhằm ứng phó với các nguy cơ như sự mở rộng liên minh NATO, kế hoạch lá chắn tên lửa từ Mỹ và cuộc khủng hoảng chính trị ở Ukraine.', '', '<p>"Chúng tôi dự định hoàn thành sửa đổi học thuyết quân sự trong năm nay", hãng tin RIA Novosti dẫn lời Mikhail Popov, Phó chủ tịch Hội đồng An ninh Nga, nói. "Tôi không có nghi ngờ nào về việc các cơ sở hạ tầng thuộc NATO xâm lấn biên giới của chúng tôi, bao gồm mở rộng liên minh, sẽ thuộc nhóm những nguy cơ quân sự lớn nhất với Liên bang Nga". Một nhóm đặc biệt đã được thiết lập theo khuôn khổ hội đồng để trình bày sửa đổi trong học thuyết quân sự Nga. Học thuyết được cập nhật lần gần đây nhất là vào năm 2010. Ông Popov cho biết học thuyết năm 2010 từng gây ra phản ứng mạnh, với việc một số quan chức Nga cấp cao nói NATO không phải là kẻ thù. "Chúng tôi đã được đảm bảo bằng những hành động thiện chí, nhưng các động thái trong thời gian gần đây lại cho thấy sự khác biệt", Popov nói. Phó chủ tịch Hội đồng An ninh Nga đánh giá quyết định xây dựng một hệ thống phòng thủ tên lửa toàn cầu để tăng cường khả năng tấn công chiến lược của Mỹ cùng đồng minh NATO cũng là sự đe dọa an ninh với Moscow. Nội dung cập nhật cũng sẽ đề cập đến "những mối đe dọa quân sự mới, có liên quan đến sự kiện Mùa xuân Arab, xung đột quân sự ở Syria, tình hình ở Ukraine và xung quanh nước này". Sửa đổi học thuyết quân sự còn tác động đến tính độc lập của Nga trong việc sản xuất vũ khí, khí tài cùng trang thiết bị quân sự khác. Quyết định sửa đổi học thuyết quân sự được Moscow đưa ra sau khi liên minh quân sự NATO muốn thiết lập một lực lượng phản ứng nhanh, có thể được điều động đến điểm nóng tại khu vực trong ít nhất hai ngày, để đối phó với cuộc khủng hoảng Ukraine. Trên thực tế, NATO đã có sẵn một lực lượng phản ứng nhanh, nhưng nó phải mất năm ngày để di chuyển tới các địa điểm cần thiết. Thiết lập các lực lượng mới là một trong những biện pháp thuộc "kế hoạch hành động sẵn sàng" mà NATO sẽ thông qua tại Hội nghị thượng đỉnh được tổ chức ở xứ Wales vào ngày 4/9, nhằm xử lý tình hình Ukraine hiện nay.</p>\r\n', '', '/uploads/tintuc/20VTqDIg1ndSoPGqO63s_A Twist In My Story (Deluxe Edition).jpg', 'packages/anahkiasen/illuminage/a2d5045d216552fd345e7041d763ef03.jpg', 1, 0, 0, 'Nga sửa đổi học thuyết quân sự để đối phó NATO', '', 'quan su nato', '', 'quan su, nato', '', '0000-00-00 00:00:00', '2015-03-22 01:28:19'),
(2, 0, '5', 'Tập đoàn Thái Lan rót thêm 530 triệu USD vào Việt Nam', '', 'tap-doan-thai-lan-rot-them-530-trieu-usd-vao-viet-nam', '', 'Tổng số vốn đầu tư trên sẽ dùng để xây Khu công nghệ cao và Khu đô thị dịch vụ tại Đồng Nai. Nơi đây cũng được kỳ vọng trở thành Trung tâm tài chính của châu Á.', '', 'Trao đổi với VnExpress.net, ông Huỳnh Ngọc Phiên, Tổng giám đốc Công ty cổ phần Amata Việt Nam (Thuộc Tập đoàn Amata Thái Lan) cho biết, đơn vị vừa hoàn thành ký kết thỏa thuận hợp tác với UBND tỉnh Đồng Nai triển khai dự án Khu công nghệ cao và Khu đô thị dịch vụ tại huyện Long Thành (tỉnh Đồng Nai).\r\n\r\nDự án có tên gọi Amata Express City, tổng vốn đầu tư 530 triệu USD, dự kiến được triển khai trên quy mô 1.285 ha. Trong đó, 410 ha dành cho khu công nghiệp công nghệ cao, phần còn lại dành cho khu đô thị dịch vụ, dân cư, trung tâm tài chính... Dự án này Amata sẽ nắm giữ 80,5%, còn Tổng công ty phát triển khu công nghiệp Sonadezi (tỉnh Đồng Nai) là 19,5%.\r\n\r\nÔng Phiên cho biết thêm, hiện dự án đang trong quá trình thẩm định lại toàn bộ địa hình để bắt đầu xây dựng vào năm 2016. Dự kiến sau 10 năm nữa sẽ hoàn thành.\r\n\r\n"Đây là dự án nằm khá gần với sân bay Long Thành trong tương lai. Theo các nhà đầu tư trong khu vực, xu hướng chuyển dịch trung tâm tài chính từ Hồng Kông sang Bangkok hay Singapore đang ngày càng mạnh mẽ. Tuy nhiên, nếu Việt Nam đón đầu được xu hướng này, nơi đây sẽ là trung tâm tài chính của châu Á trong tương lai", ông Phiên nhận định.\r\n\r\nNăm 2003, dự án đã được đề xuất với quy mô 4.000ha, nhưng do còn nhiều vấn đề trục trặc nên chưa thể tiến hành. Vài năm gần đây, quỹ đất dành cho dự án đã thu hẹp chỉ còn trên 1.000ha, vì vậy quy mô dự án đã giảm xuống nhiều lần so với dự định trước đây. "Tập đoàn đang tìm thêm nhà đầu tư chiến lược để cùng nhau phối hợp đẩy nhanh tiến độ dự án nhanh đến mức có thể", ông Phiên nói.', '', '/uploads/tintuc/Nu0sS8AxDbhVO7Kl6pUu_Christina Grimmie.png', 'packages/anahkiasen/illuminage/3a97dabe2f61220c0d47bd89acc004f4.png', 1, 1, 5, 'Tập đoàn Thái Lan rót thêm 530 triệu USD vào Việt Nam', '', '', '', '', '', '0000-00-00 00:00:00', '2014-09-03 23:51:49'),
(19, 0, '0', 'Quy định và Policy', '', 'quy-dinh-va-policy', '', 'Ba thành viên cấp cao của tổ chức khủng bố Nhà nước Hồi giáo, trong đó có trợ lý của thủ lĩnh tối cao, đã bị giết trong một cuộc không kích của Mỹ ở Iraq.', '', '<p>NBC News dẫn tin từ các quan chức an ninh Iraq cho biết, Abu Hajar Al-Sufi, là nhân vật cấp cao nhất của Nhà nước Hồi giáo (IS) bị tiêu diệt trong cuộc tấn công trên. Tên này là trợ lý chủ chốt của thủ lĩnh tối cao IS Abu Bakr al-Baghdadi. Hai thành viên còn lại gồm một "chuyên gia về chất nổ" và một "lãnh đạo quân sự" ở thành phố phía bắc Tal Afar. Lầu Năm Góc từ chối xác nhận thông tin trên. Trong khi đó, phát ngôn viên quân đội Mỹ, đại tá Steve Warren, cho hay các cuộc không kích của Mỹ chưa nhằm vào bất cứ lãnh đạo nào của IS, nhưng có thể những kẻ này đã thiệt mạng trong các vụ tấn công nhằm ngăn chặn sự triển khai quân của tổ chức này. Mỹ đã tiến hành hơn 100 cuộc không kích vào các cứ điểm và phương tiện của IS trên khắp miền bắc Iraq trong những tuần qua theo đề xuất từ chính phủ nước này. Cuộc không kích mới nhất diễn ra sau khi IS hôm 2/9 đăng tải video quay lại cảnh chặt đầu nhà báo Mỹ thứ hai Steven Sotloff. Một video tương tự về đồng nghiệp của anh là James Foley được chúng tung ra hôm 19/8. Cái chết của Sotloff một lần nữa kéo theo những chỉ trích rằng Tổng thống Mỹ Barack Obama chưa nỗ lực hết sức để tiêu diệt nhóm khủng bố trên. Tuy nhiên, phó Tổng thống Joe Biden thề rằng nước Mỹ sẽ truy đuổi những kẻ man rợ của IS đến "cổng địa ngục".</p>\r\n', '', '/uploads/tintuc/YW8oWVF6DLO4ZvU7REA5_Nguyen Khang.jpg', 'packages/anahkiasen/illuminage/a04f6587552d77d1fe5885e4f0c7fe19.jpg', 1, 0, 2, '', '', '', '', '', '', '2014-09-04 19:14:09', '2015-02-13 09:59:53'),
(20, 0, '0', 'Cách thức giao hàng và thanh toán', '', 'cach-thuc-giao-hang-va-thanh-toan', '', '', '', '<p>Xin chào các bạn, sau khi thực hiện order, chúng tôi sẽ dựa vào các thông tin mà bạn đã điền vào form đặt hàng để liên hệ với bạn, cũng như để biết rõ địa chỉ để giao hàng được chính xác.</p>\r\n\r\n<p>Các bạn có 2 phương thức thanh toán :&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Chuyển khoản vào tài khoản của shop với các nội dung như tên, số điện thoại để chúng tôi xác minh, sau khi xác minh thành công, đơn hàng sẽ được chuyển đến bạn nhanh nhất tùy thuộc vào địa chỉ của bạn.</li>\r\n	<li>Các bạn có thể đưa tiền trực tiếp khi chúng tôi giao hàng, đối với các tỉnh khác thì sẽ có thêm tiền ship cho bưu điện.</li>\r\n</ol>\r\n', '', '/uploads/tintuc/eO4nV5qbaIGuwYJvY0kh_Hear Me Now.png', 'packages/anahkiasen/illuminage/424a572af1142dc434b5e63e58495ad7.png', 1, 0, 0, '', '', '', '', '', '', '2014-09-05 03:50:03', '2015-04-12 00:49:20'),
(21, 0, '0', 'Hướng dẫn thanh toán', '', 'huong-dan-thanh-toan', '', 'Tưởng chỉ đau bụng bình thường, chị Lan mua thuốc uống và vẫn đi làm. Khi bệnh trở nặng, các bác sĩ không cứu được chị.', '', '<p>Đánh trống khai giảng và phát biểu tại THCS Nam Từ Liêm (Hà Nội), GS Nguyễn Thiện Nhân, Chủ tịch Ủy ban Trung ương Mặt trận tổ quốc Việt Nam, nguyên Bộ trưởng GD&amp;ĐT cho biết, năm 1945 Việt Nam có 95% người dân không biết đọc biết viết, đất nước có muôn vàn khó khăn. Nhưng ngày nay, Việt Nam đã là nước phát triển, tham gia sát hạch PISA 2013 đạt kết quả cao. "Một đất nước 69 năm trước không có tên trên bản đồ thế giới, nay mỗi năm xuất khẩu khoảng 20 tỷ USD gạo, xuất khẩu điện thoại cũng tương tự. Tất cả đều là nhờ giáo dục", ông Nhân nói và nhắc lại lời Chủ tịch Hồ Chí Minh rằng "một dân tộc dốt là một dân tộc yếu", "non sông Việt Nam có sánh vai với các cường quốc năm châu hay không là nhờ vào công học tập của các cháu". Gọi một học sinh lên, GS Nguyễn Thiện Nhân bất ngờ đặt câu hỏi: "Theo cháu, học để làm gì?". Cô học sinh tên Minh Thu nhanh nhảu trả lời: "Thưa bác, học là để làm người ạ". "Vậy làm người là như thế nào" - "Nghĩa là biết yêu gia đình, yêu quê hương đất nước, đóng góp sức lực xây dựng quê hương. Nếu thế hệ đầu tiên vững chắc, thì thế hệ tương lai sẽ vươn lên". Nghe câu trả lời của nữ sinh lớp 9, GS Nguyễn Thiện Nhân nhận xét: "Tôi rất vui, hài lòng và ngạc nhiên với câu trả lời của Minh Thu. Không phải ai cũng trả lời được câu hỏi “học để làm gì”, mà trả lời hay như thế là trình độ đã ngang với nguyên Bộ trưởng Giáo dục rồi đấy. Học không phải chỉ để làm người con hiếu thảo trong gia đình, mà còn để làm công dân tốt. Giáo dục phải cung cấp những con người có hiểu biết và đạo đức để xây dựng đất nước". Giáo sư cho biết, giáo dục đào tạo là quốc sách nhưng hiện ở vùng nông thôn, miền núi còn nhiều khó khăn. Số phòng học tạm bợ còn nhiều. Bình quân cho học sinh Việt Nam từ mầm non đến đại học mỗi ngày là một USD, trong khi các nước trung bình khác là 10-20 USD, nước giàu còn nhiều hơn. Vì vậy, học sinh Việt Nam phải cố gắng học cho mình, học cho Hà Nội và học cho đất nước. Mang đến trường THCS Nam Từ Liêm ba món quà, Chủ tịch Ủy ban Trung ương Mặt trận tổ quốc Việt Nam cho biết, ông tặng chiếc đồng hồ cho nhà trường với lời nhắn nhủ hãy biết trân quý thời gian. Đó là chiếc đồng hồ to nhưng không có pin. "Muốn đồng hồ chạy các thầy cô phải lên dây bằng tay mỗi tuần họp hội đồng sư phạm. Điều đó giúp nhịp sống nhà trường luôn mới mẻ hơn", GS Nhân nhắn nhủ. Hai món quà còn lại là chiếc tivi nhằm phục vụ quá trình học tập, giảng dạy của nhà trường và bức tranh lớp học những năm 60, có những học sinh đội mũ rơm. "Mũ rơm mềm, tránh được bom bi. Học sinh thời điểm này học ở dưới hầm, khi đi học đội mũ rơm trên đầu. Mấy chục năm sau người đội mũ rơm thành giáo sư. Điều đó chứng tỏ rằng với tinh thần của người Việt Nam, mũ rơm sẽ chiến thắng", nguyên Bộ trưởng Giáo dục Việt Nam nói.</p>\r\n', '', '/uploads/tintuc/D51gFYHJHQqkW84OJ20l_A Twist In My Story (Deluxe Edition).jpg', 'packages/anahkiasen/illuminage/3b83014dfe14c33f74adb28d0cc051ef.jpg', 1, 0, 0, 'Giới thiệu CMS DETROOPER.COM', '', 'Giới thiệu CMS DETROOPER.COM', '', 'Giới thiệu CMS DETROOPER.COM', '', '2014-09-05 09:03:35', '2015-02-13 09:57:23'),
(26, 0, '0', 'Hướng dẫn sử dụng tool thiết kế', '', 'huong-dan-su-dung-tool-thiet-ke', '', 'Trong những ngày qua, báo giới liên tiếp đưa tin rằng cả Chelsea và M.U đều đang muốn chiêu mộ “siêu sao” C.Ronaldo của Real Madrid trong mùa Hè tới. Đây không hẳn là nhiệm vụ bất khả thi. Sau khi giành mọi danh hiệu cao quý cùng Los Blancos, CR7 hoàn toà', '', '<h2>Is Lorem Ipsum Just a Wacky Random Thingy?</h2>\r\n\r\n<p>Well, in the first sight, it looks like it. To be honest, it also looks like it when you stare at it for hours. But you see, Lorem Ipsum is not just a Wacky Random Thingy. It has a meaning and even an actual human being author. His father is not php’s rand() function, but a famous and wise (now already old) man Cicero. Lorem Ipsum text originates from Cicero’s text titled “de Finibus Bonorum et Malorum”. No, it’s not about U2 front man Bono fighting against malaria; it’s actually a text about the extremes of the good and the evil. Text was written in 45 BC.</p>\r\n\r\n<p>45 BC is like waaaay back! But don’t you worry – our Lorem Ipsum Generator is made with 21st century technology, so it will give you perfect Lorem Ipsumish results each and every time you use it. Don’t believe it? Just try it!</p>\r\n\r\n<p>“Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum,” said our Lorem Ipsum Generator and asked if you would like it in italics, bold and with some paragraphs.</p>\r\n', '', '/uploads/tintuc/JiLNhDXezA0InH9A3641_Ronaldo.jpg', 'packages/anahkiasen/illuminage/027ca9153c2cb2a6c02cf9846d20f4fd.jpg', 1, 0, 0, 'Theo tờ Daily Mail, CR7 muốn nhận mức lương 500000 bảng/tuần để chuyển tới thi đấu cho Man Utd hoặc Chelsea.', '', 'Theo tờ Daily Mail, CR7 muốn nhận mức lương 500000 bảng/tuần để chuyển tới thi đấu cho Man Utd hoặc Chelsea.', '', 'Theo tờ Daily Mail, CR7 muốn nhận mức lương 500000 bảng/tuần để chuyển tới thi đấu cho Man Utd hoặc Chelsea.', '', '2014-09-14 00:01:52', '2015-02-13 09:56:39');

